import React from 'react';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import Container from 'react-bootstrap/Container';
import InstaIcon from '../../src/Images/contactImages/InstaIcon.png';
import TwitterIcon from '../../src/Images/contactImages/TwitterIcon.png';
import FacebookIcon from '../../src/Images/contactImages/FacebookIcon.png';
import SocialImage from '../../src/Images/contactImages/SocialImage.png';

class Statement extends React.Component {
  render() {
    return (
      <Container className="strip">
        <div className="container">
          <div className="grid-row grid-row--middle u-padding-top-large u-padding-bottom-large u-padding-top-none-md u-padding-bottom-none-md">
            <div className="grid-col-12 u-align-center">
              <h3 className="u-font-size-h2 u-font-bold">
                Help us build the kind of bank you want to use
              </h3>
              <p>
                Download the Monzo app on iOS or Android and join the people whove changed the way they bank.
              </p>
            </div>
          </div>
        </div>
      </Container>
    )
  }
}
export default Statement;
